import { useState } from "react";
import "./styles.scss";

const Portfolio = () => {

  const [project, setProject] = useState("tussle");

  return (
    <article id="portfolio">
      <div>
        <label for="tussle">Tussle</label>
        <input checked={project==="tussle"? true: false} id="tussle"
          name="project"  type="radio"
          onChange={() => {
            setProject("tussle");
          }}
        />
        <div />
      </div>
      <div>
        <label for="shadow">Shadow</label>
        <input checked={project==="shadow"? true: false} id="shadow"
          name="project" type="radio"
          onChange={() => {
            setProject("tussle");
          }}
        />
        <div />
      </div>
    </article>
  )
}

export default Portfolio
